import React from "react"
import './styles/App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Home from "./Home"

const App = () => {

  return (
    <div>
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home/>}></Route>
      </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;
